def load_sparse_csr(filename):
    loader = np.load(filename)
    return csr_matrix((loader['data'], loader['indices'], loader['indptr']), shape=loader['shape'])



def calculate(origin, destination, length, speed, ready, due, headway, k):
    g = create_graph()
    paths, used_nodes = k_short(g,origin, destination, k)
    h = copy.deepcopy(g)
    keymap = {}
    for v in h.nodes():
        if v not in used_nodes:
            h.remove_node(v)
    for v in h.nodes():
        keymap[h.nodes().index(v)] = v
    print(keymap)
    convoy_count = len(origin)
    node_count = h.number_of_nodes()
    distances = nx.to_numpy_matrix(h, weight="weight")

    new_origin = [h.nodes().index(origin[i]) for i in range(len(origin))]
    new_destination = [h.nodes().index(destination[i]) for i in range(len(origin))]
    print(new_origin, new_destination)
    print(used_nodes)
    result={c:{} for c in range(convoy_count)}
    print(h.nodes())
    print("rajad", paths)
    pre_result = solve(node_count, convoy_count, new_origin, new_destination, length, ready, due, distances, speed, headway, 30000, k, h.nodes(), paths)
    print(pre_result)
    for c, n in pre_result.items():
        for k,v in n.items():
            result[c][keymap[k]] = v

    solution = []
    for k,v in result.items():
        path = [e for e,f in sorted(v.items(), key=operator.itemgetter(1))]
        travel_time = result[k][path[-1]] - result[k][path[0]]
        start_time = result[k][path[0]]
        solution.append([path, travel_time, start_time, k+1])

    solution = sorted(solution, key=operator.itemgetter(3))

    return solution

